insert  into `abstrak`(`No`,`Kelas`,`Abstrak`,`preProsesing`) values (1,'CS','ABSTRAK ANALISIS PERFORMANSI METODE ADAPTIVE NEURO FUZZY INFERENCE SYSTEM (ANFIS) UNTUK MEMPREDIKSI TINGKAT POTENSI BANJIROleh : Willy Adhi Wiguna 10111583.Adaptive Neuro Fuzzy Inference System (ANFIS) merupakan suatu struktur yang menggabungkan system fuzzy dan system jaringan saraf tiruan. ANFIS yang menggunakan suatu prosedur learning dapat membangun suatu mapping input-output yang keduanya berdasarkan pada pengetahuan manusia (pada aturan fuzzy if-then). Banjir merupakan kejadian bencana alam yang sering terjadi dan cukup sulit untuk diprediksi. Prediksi kejadian bencana alam khususnya banjir merupakan hal yang cukup penting untuk diketahui karena dengan dapat memprediksi bencana banjir kita dapat melakukan pencegahan dini sehingga dapat mengurangi dampak yang akan terjadi.Dalam melakukan proses analisis, terdapat 105 data kelurahan yang berada di wilayah Daerah Aliran Sungai (DAS) CItarum, setiap kelurahan dibagi kedalam 3 kategori, yaitu : kategori kurang rawan, cukup rawan, dan sangat rawan. Setiap data pembelajaran dan data uji dibagi sama rata untuk tiap kategorinya. Setiap kelurahaan memiliki 4 parameter, yaitu parameter curah hujan, jenis tanah, kemiringan lereng, dan penggunaan lahan. Dengan menggunakan metode ANFIS,4 parameter tersebut digunakan sebagai masukan bagi system, lalu parameter-parameter tersebut akan melalui proses-proses pada tiap lapisan yang terdapat pada metode ANFIS. Mulai dari proses fuzzyfication, inference fuzzy, normalisasi, LSE, dan defuzzyfication sampai pada tahap pembelajaran mundur menggunakan metode Error Back-Propagation.Berdasarkan hasil pembelajaran dengan menggunakan 90 data kelurahan dan uji coba dengan menggunakan 15 data kelurahan yang telah dilakukan, ANFIS dapat digunakan untuk memprediksi tingkat potensi banjir dengan nilai akurasi terbesar didapatkan sebesar 93.33% dan dengan rata-rata akurasi yang didapat sebesar 62.67% dengan pengujian confusion matrix.Kata Kunci : prediksi, potensi banjir, System Fuzzy, Jaringan Syaraf Tiruan, ANFIS','abstrak analisis performansi metode adaptive neuro fuzzy inference system anfis prediksi potensi banjir willy adhi wiguna adaptive neuro fuzzy inference system anfis struktur gabung system fuzzy system jaring saraf tiru anfis prosedur learning bangun mapping input dua pengetahuan manusia atur fuzzy if banjir bencana alam sulit prediksi prediksi bencana alam khusus banjir tahu prediksi bencana banjir cegah dini urang dampak analisis dapat data lurah wilayah daerah alir sungai das citarum lurah bagi dalam kategori kategori kurang rawan rawan rawan data pembelajaran data uji bagi rata tiap kategori kelurahaan parameter parameter curah hujan tanah miring lereng lahan metode anfis parameter masuk system parameter proses tiap lapis dapat metode anfis fuzzyfication inference fuzzy normalisasi lse defuzzyfication tahap pembelajaran mundur metode error back pembelajaran data lurah uji coba data lurah anfis prediksi potensi banjir nilai akurasi terbesar dapat rata akurasi dapat uji confusion matrix kunci prediksi potensi banjir system fuzzy jaring syaraf tiru anfis'),(2,'CS','ABSTRAK ANALISIS SENTIMEN PADA AKUN TWITTER PROVIDER TELEKOMUNIKASIOleh : SOLAHUDIN ANWAR 10110433.Layanan jejaring sosial Twitter saat ini banyak digunakan oleh provider telekomunikasi sebagai media komunikasi dan penyampaian opini dari pengguna terhadap layanan yang digunakannya. Setiap opini pada tweet yang dikirim kepada akun twitter provider dapat bermanfaat sebagai penilaian terhadap layanannya. Banyaknya dan beragamnya tweet akan membutuhkan waktu yang lama untuk memeriksanya. Masalah tersebut dapat diselesaikan dengan menggunakan analisis sentimen. Secara garis besar analisis sentimen merupakan proses klasifikasi dokumen tekstual ke dalam dua kelas, yaitu kelas sentimen positif dan kelas sentimen negatif.Pada penelitian ini metode klasifikasi yang digunakan untuk analisis sentimen adalah metode klasifikasi Support Vector Machine (SVM) dan metode klasifikasi Naive Bayes. Prinsip dasar metode SVM adalah pengklasifikasian linear (linear classifier). Metode klasifikasi Naive Bayes adalah metode klasifikasi probabilistik sederhana berdasarkan penerapan teorema Bayes. Proses yang terdapat pada analisis sentimen dimulai dengan preprocessing terhadap data tweet. Setelah preprocessing, dilakukan klasifikasi tweet terhadap kelas relevan dan kelas non relevan menggunakan metode Support Vector Machine. Pada tahap akhir dilakukan klasifikasi terhadap kelas positif dan kelas negatif menggunakan metode klasifikasi Naive Bayes.Berdasarkan dari penelitian yang telah dilakukan, dengan menggunakan metode pengujian confusion matrix terhadap hasil klasifikasi dari metode klasifikasi Naive Bayes untuk kelas tweet positif dan negatif diperoleh akurasi 96% dari 300 data yang diuji.Kata kunci : Analisis Sentimen, Naive Bayes Classifier, Support Vector Machine, Preprocessing, Twitter','abstrak analisis sentimen akun twitter provider telekomunikasi solahudin anwar layan jejaring sosial twitter provider telekomunikasi media komunikasi sampai opini guna layan guna opini tweet kirim akun twitter provider manfaat nilai layan banyak agam tweet butuh periksa selesai analisis sentimen garis analisis sentimen klasifikasi dokumen tekstual kelas kelas sentimen positif kelas sentimen negatifpada penelitian metode klasifikasi analisis sentimen metode klasifikasi support vector machine svm metode klasifikasi naive bayes prinsip dasar metode svm klasifikasi linear linear classifier metode klasifikasi naive bayes metode klasifikasi probabilistik sederhana penerapan teorema bayes dapat analisis sentimen mulai preprocessing data tweet preprocessing klasifikasi tweet kelas relevan kelas non relevan metode support vector machine tahap klasifikasi kelas positif kelas negatif metode klasifikasi naive bayesberdasarkan penelitian metode uji confusion matrix klasifikasi metode klasifikasi naive bayes kelas tweet positif negatif oleh akurasi data uji kunci analisis sentimen naive bayes classifier support vector machine preprocessing twitter'),(3,'CS','ABSTRAK ANALISIS PERBANDINGAN LEARNING VECTOR QUANTIZATION DENGAN ADAPTIVE NEURO FUZZY INFERENCE SYSTEM PADA KLASIFIKASI TINGKAT KEMATANGAN TOMATOleh : Fitri Yani 10111590.Pengenalan pola merupakan suatu cara untuk mendeskripsikan atau mengklasifikasikan suatu data kedalam kelompok tertentu berdasarkan kesamaan karakteristik yang ada dalam citra digital. Metode jaringan syaraf tiruan adalah salah satu metode untuk pengenalan pola. Learning Vector Quantization (LVQ)  dan Adaptive Neuro Fuzzy Inference System (ANFIS) merupakan metode jaringan syaraf tiruan yang dapat digunakan untuk mengenali pola. Kedua metode tersebut biasa digunakan untuk melakukan klasifikasi, namun keakuratan kedua metode tersebut belum diketahui mana yang lebih baik jika diterapkan pada satu masalah.Tomat mempunyai tingkat kematangan yang berbeda-beda, agar dapat mendapatkan kualitas tomat yang baik saat panen hingga pemasaran, diperlukan perlakuan yang berbeda pada tiap tingkat kematangan tomat seperti suhu, jumlah serta jangka waktu pemupukan dan penyiraman, waktu penyimpanan, serta estimasi waktu pemanenan. Oleh karena itu pada tugas akhir ini akan mencoba menerapkan membandingkan LVQ dan ANFIS untuk klasifikasi tingkat kematangan tomat guna diketahui metode mana yang memiliki keakuratan yang lebih baik.Berdasarkan hasil pembelajaran dan pengujian yang telah dilakukan, LVQ dan ANFIS memiliki keakuratan yang berbeda. Besar nilai error klasifikasi pada LVQ = 0.6042 dan ANFIS = 0.1528. Nilai error tersebut menandakan besarnya kesalahan klasifikasi yang dilakukan. ANFIS memiliki kesalahan klasifikasi yang lebih rendah dibandingkan LVQ. Sehingga dapat disimpulkan ANFIS lebih baik daripada LVQ dalam klasifikasi tingkat kematangan tomat.Kata Kunci : jaringan syaraf tiruan, learning vector quantization, adaptive neuro fuzzy inference system, tingkat kematangan tomat, cross validation, confusion matrix','abstrak analisis banding learning vector quantization adaptive neuro fuzzy inference system klasifikasi matang tomat fitri yani pengenalan pola deskripsi klasifikasi data dalam kelompok tertentu sama karakteristik citra digital metode jaring syaraf tiru metode pengenalan pola learning vector quantization lvq adaptive neuro fuzzy inference system anfis metode jaring syaraf tiru kenal pola metode klasifikasi akurat metode tahu terap tomat matang beda kualitas tomat panen pemasaran perlu laku beda tiap matang tomat suhu jangka pemupukan siram simpan estimasi pemanenan tugas coba terap banding lvq anfis klasifikasi matang tomat guna tahu metode akurat pembelajaran uji lvq anfis akurat beda nilai error klasifikasi lvq anfis nilai error tandak besar salah klasifikasi anfis salah klasifikasi rendah banding lvq simpul anfis daripada lvq klasifikasi matang tomat kunci jaring syaraf tiru learning vector quantization adaptive neuro fuzzy inference system matang tomat cross validation confusion matrix'),(4,'CS','ABSTRAK ANALISIS SENTIMEN PENGGUNA TWITTER TERHADAP PARAI POLITIK PESERTA PEMILU 2014 MENGGUNAKAN ALGORITMA C4.5 DECISION TREE LEARNINGOleh : TEDDY MAULANA 10110304.Pada tahun 2014 dilaksanakan PEMILU yang menjadi perhatian masyarakat, informasi digunakan masyarakat untuk menilai partai politik perserta salah satunya opini negatif dan positif yang berasal dari twitter. Dalam menentukan polaritas positif atau negatif suatu opini dapat dilakukan secara manual, tetapi mempertimbangkan bertambahnya opini menjadi semakin banyak, tentunya banyak waktu yang akan semakin banyak terpakai. Maka diajukan sebuah metode machine learning untuk mengklasifikasikan konten opini dari sumber data yang sangat banyak. Metode machine learning untuk melakukan analisis terhadap konten tweet yaitu menggunakan pohon keputusan atau decision tree learning yang dibangun dengan algoritma C 4.5. Pada penelitian ini akan dilakukan analisis tweet yang bersifat opini terhadap partai politik peserta PEMILU 2014. Analisis sentimen terhadap partai politik dilakukan untuk menganalisa opini negatif dan positif dari pengguna twitter terhadap partai peserta PEMILU 2014. Hasil dari pengujian alpha menunjukan bahwa sistem analisis sentimen menggunakan algoritma C4.5 bebas dari kesalahan sintak dan berjalan sesuai dengan fungsinya. Hasil pengujian beta terhadap 42 responden dapat disimpulkan bahwa aplikasi analisis sentimen ini baik untuk referensi tambahan masyarakat terhadap partai politik. Hasil dari pengujian akurasi klasifikasi menggunakan pohon keputusan yang dibangun algoritma C4.5 berdasarkan data latih dan 150 data uji yang digunakan menghasilkan rata rata error 36%.Kata Kunci: Sentimen, PEMILU, Partai Politik, Text Processing, Algoritma C.4.5.','abstrak analisis sentimen guna twitter para politik serta milu algoritma decision tree learning teddy maulana laksana milu hati masyarakat informasi masyarakat nilai partai politik serta satu opini negatif positif asal twitter tentu polaritas positif negatif opini manual timbang tambah opini tentu pakai ajuk metode machine learning klasifikasi konten opini data metode machine learning analisis konten tweet pohon decision tree learning bangun algoritma penelitian analisis tweet sifat opini partai politik serta milu analisis sentimen partai politik analisa opini negatif positif guna twitter partai serta milu uji alpha tunjuk sistem analisis sentimen algoritma bebas salah sintak fungsi uji beta responden simpul aplikasi analisis sentimen referensi tambah masyarakat partai politik uji akurasi klasifikasi pohon bangun algoritma data latih data uji hasil rata rata error kunci sentimen milu partai politik text processing algoritma'),(5,'IS','ABSTRAK CUSTOMER RELATIONSHIP MANAGEMENT (CRM) DI PT. AZIZI AUDHINIA WISATA TOUR  DAN TRAVELOleh : SANDI LESMANA 10109126.PT. Azizi Audhinia Wisata merupakan sebuah perusahaan yang bergerak dalam bidang jasa transportasi parawisata yang fungsi utamanya adalah untuk memberikan kemudahan kepada pelanggan dalam mendapatkan pelayanan jasa perusahaan. Perusahaan ini berpusat di Medan dan memiliki beberapa kantor cabang, salah satunya berada di Bekasi. Sebagai sebuah perusahaan dalam bidang transportasi PT.Azizi Audhinia Wisata perlu memberikan pelayanan yang terbaik kepada semua pelanggan. Pelanggan merupakan asset yang sangat penting bagi perusahaan. Hal ini adalah alasan mengapa perusahaan harus merencanakan dan menggunakan strategi yang cukup jelas. Maka masalah yang harus dihadapi adalah bagaimana menentukan pelanggan potensial dan tidak potensial. Dengan menerapkan konsep CRM (Customer Relationship Management). Tujuan dari proses identifikasi pelanggan adalah untuk mengetahui perilaku pelanggan dan menerapkan strategi pemasaran yang tepat, dengan media SMS Gateway untuk memberikan penawaran program-program perusahaan kepada pelanggan dengan tepat sasaran. Identifikasi pelanggan dapat dilakukan dengan cara mengelompokan pelanggan dari data transaksi pelanggan menggunakan metode RFM yaitu model berdasarkan atribut Recency, Frequency, dan Monetary, karena metode ini menilai dari Recency yaitu rentang waktu dari transaksi terakhir yang dilakukan oleh konsumen sampai saat ini, Frequency yaitu jumlah total transaksi atau jumlah rata-rata transaksi dalam satu periode, monetary yaitu jumlah rata-rata nilai pembelian konsumen dalam satuan waktu. Berdasarkan hasil pengujian dapat diperoleh kesimpulan bahwa sistem yang dibangun dapat mempermudah perusahaan dalam menentukan pelanggan potensial dan tidak potensial agar pemasaran yang diberikan perusahaan lebih terarah dan tepat, sehinggan diharapkan dapat menjaga dan menjalin hubungan baik dengan pelanggan.Kata kunci : Customer Relationship Management (CRM), Metode RFM','abstrak customer relationship management crm pt aziz audhinia wisata tour travel sandi lesmana pt aziz audhinia wisata usaha gerak bidang jasa transportasi parawisata fungsi utama mudah langgan layan jasa usaha usaha pusat medan kantor cabang satu kas usaha bidang transportasi ptazizi audhinia wisata layan baik langgan langgan asset usaha alas apa usaha rencana strategi hadap tentu langgan potensial potensial terap konsep crm customer relationship management tuju identifikasi langgan perilaku langgan terap strategi pemasaran tepat media sms gateway penawaran program usaha langgan tepat sasar identifikasi langgan kelompok langgan data transaksi langgan metode rfm model atribut recency frequency monetary metode nilai recency rentang transaksi konsumen frequency total transaksi rata transaksi periode monetary rata nilai beli konsumen satu uji oleh simpul sistem bangun mudah usaha tentu langgan potensial potensial pemasaran berik usaha arah tepat sehinggan harap jaga jalin langgan kunci customer relationship management crm metode rfm'),(6,'CS','ABSTRAK PEMBANGUNAN APLIKASI IMAGE RETRIEVAL DENGAN MENGGUNAKAN METODE HISTOGRAM EUCLIDEAN DISTANCE BERDASARKAN WARNAOleh : ADHADIAT SATYA NUGRAHA 10109403.Teknik pencarian citra disebagian besar sistem operasi adalah berbasis kueri teks, contohnya nama citra. Dimana teknik ini mudah digunakan jika pengguna sekilas mengingat nama file citra tersebut, namun tidak dapat digunakan jika pengguna hanya mengingat gambar dari citra. pencarian citra tersebut hanya dapat dilakukan secara manual oleh pengguna. Pembangunan aplikasi image retrieval ini merupakan solusi dari masalah pencarian berbasis kueri teks tersebut. Dimana hasil pencarian dengan aplikasi ini akan menampilkan citra-citra yang sama dan mirip dengan citra kueri yang di masukkan pengguna. Aplikasi ini menggunakan Metode histogram eulidean distance berdasarkan warna untuk melakukan komputasi jarak histogram warna antar citra. Hasil pengujian menunjukkan bahwa implementasi metode histogram euclidean distance dapat menjalankan tugas utamanya dalam aplikasi image retrieval dengan cukup baik. dari hasil percobaan yang telah dilakukan terhadap beberapa citra uji, dapat diketahui bahwa hasil pencarian dapat menampilkan citra yang sama dengan citra uji dan untuk citra yang tidak ditemukan hasil pencarian menampilkan citra-citra yang dianggap mirip berdasarkan jarak. Kata kunci : pencarian, citra, histogram euclidean distance, warna.','abstrak bangun aplikasi image retrieval metode histogram euclidean distance warna adhadiat satya nugraha teknik cari citra bagi sistem operasi basis kueri teks contoh citra mana teknik mudah guna kilas ingat file citra guna ingat gambar citra cari citra manual guna bangun aplikasi image retrieval solusi cari basis kueri teks mana cari aplikasi tampil citra mirip citra kueri masuk guna aplikasi metode histogram eulidean distance warna komputasi jarak histogram warna antar citra uji implementasi metode histogram euclidean distance jalan tugas utama aplikasi image retrieval coba citra uji tahu cari tampil citra citra uji citra cari tampil citra anggap mirip jarak kunci cari citra histogram euclidean distance warna'),(7,'IS','ABSTRAK PEMBANGUNAN SISTEM INFORMASI CUSTOMER RELATIONSHIP MANAGEMENT (CRM) DI METRO LAUNDRYOleh : AANG GUSTIJAR 10111720.Metro Laundry merupakan suatu usaha yang bergerak dibidang jasa Laundry dry dengan konsep berdasarkan jumlah berat (kg) atau satuan. Hingga tahun 2015 Metro laundry telah memiliki 3 cabang yang tersebar didaerah Bandung, diantaranya: Sukabirus, Asrama Telkom, dan Cikoneng sebagai pusat. Mayoritas pelanggan Metro laundry adalah mahasiswa. Namun, saat ini Metro laundry telah bekerja sama dengan Asrama dan Hotel di daerah Bandung. Customer Relationship management (CRM) adalah jenis manajemen yang membahas mengenai penanganan hubungan antara perusahaan dengan pelanggan yang dapat membantu perusahaan dalam proses managemen pelanggan, sehingga perusahaan memiliki nilai yang baik dimata pelanggan. Sebuah perusahaan harus memiliki strategi yang cerdik untuk mempertahankan posisinya. Salah satu Point yang mempengaruhi keberlangsungan sebuah perusahaan adalah bagaimana pangsa pasarnya tetap diminati oleh pelanggan. Berdasarkan masalah yang telah diuraikan diatas maka dibutuhkan Sistem Informasi Customer Relationship Management di Metro Laundry berbasis web agar memudahkan pelanggan dalam mengakses sistem. Adapun jenis CRM yang dibangun adalah Analitikal. Dengan adanya sistem ini diharapkan dapat membantu memberikan solusi terhadap permasalahan yang dihadapi Metro Laundry. Kata Kunci : Metro Laundry, Customer relationship Management, Sistem Informasi, Sistem Informasi berbasis web.','abstrak bangun sistem informasi customer relationship management crm metro laundry aang gustijar metro laundry usaha gerak bidang jasa laundry dry konsep kg satu metro laundry cabang tersebar daerah bandung antara sukabirus asrama telkom cikoneng pusat mayoritas langgan metro laundry mahasiswa metro laundry kerja asrama hotel daerah bandung customer relationship management crm manajemen bahas penanganan usaha langgan usaha managemen langgan usaha nilai mata langgan usaha strategi cerdik tahan posisi point pengaruh langsung usaha pangsa pasar tetap minat langgan urai atas butuh sistem informasi customer relationship management metro laundry basis web mudah langgan akses sistem adapun crm bangun analitikal sistem harap solusi masalah hadap metro laundry kunci metro laundry customer relationship management sistem informasi sistem informasi basis web'),(8,'IS','ABSTRAK PENERAPAN METODE CUSTOMER RELATIONSHIP MANAGEMENT (CRM) DALAM SISTEM INFORMASI DI PT. NUSA PRATAMA MANDIRIOleh : INTAN NUARI WIJAYA 10110637.PT. Nusa Pratama Mandiri adalah merupakan salah satu perusahaan water & waste water treatment trading yang bergerak di bidang semical, produk yang dijual oleh PT. Nusa Pratama Mandiri diantaranya adalah pasir active, pasir silica, caporit, zeolit, serta carbon active atau yang lebih dikenal media penjernih air dan bahan kimia seperti polymer, calcium hypoclorite, H2O2 serta mangan sulfat dan dipasarkan ke pabrik tekstil, perusahaan farmasi, rumah sakit dan hotel. Saat ini proses bisnis di PT. Nusa Pratama Mandiri mengalami hambatan dengan para pelanggan, karena adanya ketidakcocokan harga dan kualitas barangnya sehingga perusahaan belum bisa memenuhi kebutuhan yang sesuai dengan keinginan pelanggan yang mengakibatkan berkurangnya pelanggan. Pihak perusahaan mengalami persaingan dengan perusahaan yang sejenis yang lebih bersaing pada penetapan target penjualan dan pemasaran, sehingga dampak pada perusahaan mengalami kesulitan dalam menentukan cara penanganan pelanggan dilihat dari potensi pembeliannya pelanggan tersebut. Penerapan Customer Relationship Mangement (CRM) dalam sistem informasi di PT. Nusa Pratama Mandiri dibangun untuk memudahkan perusahaan dalam menentukan rencana mempertahankan pelanggan dan memudahkan perusahaan dalam menentukan cara penanganan pelanggan dilihat dari potensi pembeliannya pelanggan tersebut. Berdasarkan hasil pengujian dapat disimpulkan bahwa fungsional utama dalam  sistem yang dibangun ini tidak sesuai yang diharapkan dengan yang diharapkan, maka  fungsional di sistem yang mengacu pada tujuan penelitian ini tidak tercapai.Kata Kunci : Pelanggan, Customer Relationship Management','abstrak penerapan metode customer relationship management crm sistem informasi pt nusa pratama mandiri intan nuari wijaya pt nusa pratama mandiri usaha water waste water treatment trading gerak bidang semical produk jual pt nusa pratama mandiri antara pasir active pasir silica caporit zeolit carbon active kenal media jernih air bahan kimia polymer calcium hypoclorite ho mangan sulfat pasar pabrik tekstil usaha farmasi rumah sakit hotel bisnis pt nusa pratama mandiri hambat langgan ketidakcocokan harga kualitas barang usaha penuh ingin langgan akibat kurang langgan usaha saing usaha jenis saing penetapan target jual pemasaran dampak usaha sulit tentu penanganan langgan lihat potensi beli langgan penerapan customer relationship mangement crm sistem informasi pt nusa pratama mandiri bangun mudah usaha tentu rencana tahan langgan mudah usaha tentu penanganan langgan lihat potensi beli langgan uji simpul fungsional sistem bangun harap harap fungsional sistem acu tuju penelitian capai kunci langgan customer relationship management'),(9,'CS','ABSTRAK PENGEMBANGAN KOREKSI ESAI OTOMATIS PADA E-LEARNING DI SMK PLUS AN-NABA SUKABUMI DENGAN MENGGUNAKAN  METODE LATENT SEMANTYC ANALYSIS (LSA)Oleh : MASHUN SOFYAN 10111518.Pengkoreksian soal esai secara manual yang menghabiskan waktu lebih lama dibandingkan dengan mengoreksi soal esai secara otomatis. Dibutuhkan waktu sekitar 1 menit tiap soal untuk mengkoreksi soal esai secara manual. Jika akan mengkoreksi 30 soal maka dibutuhkan waktu sekitar 30 menit, sedangkan jumlah pelajar di SMK Plus An-Naba Sukabumi sekitar 200 orang. Berdasarkan pemikiran tersebut, perlu dikembangkan sebuah sistem otomatis yang membantu proses penilaian esai. Pengembangan Sistem Penilaian Esai Otomatis pada Tugas Akhir ini menggunakan Metode Latent Semantyc Analysis (LSA) yaitu dengan merepresentasikan kalimat dalam sebuah matriks semantik yang kemudian dilakukan perhitungan matematis dengan mencocokan atau memetakan ada atau tidaknya kata dari kelompok kata pada matriks menggunakan teknik aljabar linear Singular Value Decomposition (SVD). Berdasarkan hasil data penelitian alpha dan betha dapat diambil sebuah kesimpulan bahwa pengembangan fungsionalitas koreksi esai di SMK Plus An-Naba Sukabumi mampu melaksanakan proses koreksi soal jenis esai dengan lebih cepat.Kata kunci  : LSA, Latent Semantyc Analysis, Singular Value Decomposition (SVD).','abstrak pengembangan koreksi esai otomatis e smk plus an sukabumi metode latent semantyc analysis lsa mashun sofyan koreksi soal esai manual habis banding koreksi soal esai otomatis butuh menit tiap soal koreksi soal esai manual koreksi soal butuh menit pelajar smk plus an sukabumi pemikiran kembang sistem otomatis nilai esai pengembangan sistem nilai esai otomatis tugas metode latent semantyc analysis lsa representasi kalimat matriks semantik hitung matematis cocok eta tidak kelompok matriks teknik aljabar linear singular value decomposition svd data penelitian alpha betha ambil simpul pengembangan fungsionalitas koreksi esai smk plus an sukabumi laksana koreksi soal esai cepat kunci lsa latent semantyc analysis singular value decomposition svd'),(10,'CS','ABSTRAK PERBANDINGAN METODE NAIVE BAYES DAN BACKPROPAGATION NEURAL NETWORK DALAM MENDIAGNOSA PENYAKIT SINUSITISOleh: Dwikeu Novi Asrika 10110376.Dalam mendiagnosa penyakit keakurasian data sangatlah penting karena untuk menghasilkan suatu solusi dibutuhkan keakurasian yang baik. Metode yang digunakan untuk diagnosa penyakit pun dijadikan suatu pertimbangan. Metode yang akan digunakan adalah metode Naive Bayes dan metode Backpropagation Neural Network, metode tersebut sama-sama memiliki keakurasian data yang baik. Pada penelitian sebelumnya telah dijelaskan bahwa dalam metode Naive Bayes dapat mencapai 94,4% dengan masukkan 22 gejala dan pada metode Backpropagation Neural Network mencapai 91,66% dengan 12 gejala masukkan. Dalam kedua penelitian tersebut keakurasian data dengan metode Naive Bayes lebih unggul daripada metode Backpropagation, namun dengan jumlah masukkan gejala berbeda. Tetapi kita tidak mengetahui apakah hasilnya akan sama jika gejala yang dijadikan masukkan berjumlah sama yaitu 17 gejala, apakah metode Naive Bayes masih lebih unggul atau metode Backpropagation yang menjadi lebih unggul. Berdasarkan uraian diatas yang telah disampaikan, maka akan dilakukan analisis perbandingan metode Naive Bayes dan Backpropagation Neural Nework untuk menentukan metode yang paling baik dalam segi akurasi data pada sistem pendiagnosa penyakit sinusitis dengan jumlah masukkan gejala yang sama dan menghasilkan keluaran jenis sinusitis akut, subakut atau kronis. Setelah dilakukan pengujian sistem dengan 60 data pasien yang tersedia dan jumlah masukkan (input) gejala yang sama yaitu 17 gejala, didapat hasil akurasi yang paling baik yaitu dengan menggunakan metode Naive Bayes yang tingkat keberhasilannya mencapai 93.33%. Sedangkan keberhasilan prediksi untuk metode Backpropagation Neural Network hanya mencapai 76.67%. Hal ini karena metode Naive Bayes tidak dipengaruhi oleh nilai acak(random), sedangkan metode Backpropagation Neural Network dipengaruhi oleh nilai inisialisai awal yang bersifat acak(random) yang menyebabkan nilai yang dihasilkan berubah-ubah. Kata Kunci: Diagnosa, Sinusitis, Backpropagation Neural Network, Naive Bayes, akurasi data.','abstrak banding metode naive bayes backpropagation neural network mendiagnosa sakit sinusitis dwikeu novi asrika mendiagnosa sakit akurasi data sangat hasil solusi butuh akurasi metode diagnosa sakit jadi timbang metode metode naive bayes metode backpropagation neural network metode sama akurasi data penelitian jelas metode naive bayes masuk gejala metode backpropagation neural network gejala masuk penelitian akurasi data metode naive bayes unggul daripada metode backpropagation masuk gejala beda hasil gejala jadi masuk berjum gejala metode naive bayes unggul metode backpropagation unggul urai atas sampai analisis banding metode naive bayes backpropagation neural nework tentu metode segi akurasi data sistem pendiagnosa sakit sinusitis masuk gejala hasil luar sinusitis akut subakut kronis uji sistem data pasien tersedia masuk input gejala gejala dapat akurasi metode naive bayes hasil hasil prediksi metode backpropagation neural network metode naive bayes pengaruh nilai acakrandom metode backpropagation neural network pengaruh nilai inisialisai sifat acakrandom nilai hasil ubah kunci diagnosa sinusitis backpropagation neural network naive bayes akurasi data'),(11,'IS','ABSTRAK SISTEM INFORMASI GEOGRAFIS PEMETAAN KEGIATAN DINAS PERMUKIMAN DAN PERUMAHAN PROVINSI JAWA BARAT BERBASIS WEBOleh : NAZMUDIN FIRDAOS 10109703.Meningkatnya pertumbuhan penduduk di Provinsi Jawa Barat harus diimbangi dengan ketersediaan sarana dan prasarana yang berkualitas, melalui Dinas Permukiman dan Perumahan (DISKIMRUM) memiliki tugas untuk mengoptimalkandan menata lahan untuk kegiatan pembangunan. Dalam pelaksanaannya, pengolahan data pemetaan kegiatannya masih menggunakan peta konvensional yang kurang memberikan informasi objek peta dengan lengkap. Selain itu, dokumentasi kegiatan masih menggunakan laporan berupa jurnal kegiatan. Sistem informasi geografis(SIG) digunakan untuk memvisualisasikan penyebaran data, sehingga memudahkan pengguna untuk memperoleh informasi dan menganalisa data yang ada. Dengan menggunakan metode AHP (Analytic Hierarchy Processing) data akan diolah menjadi kriteria yang mempunyai bobot tertentu untuk menentukan rekomendasi lokasi pembangunan,berdasarkan data yang diperoleh seperti data jumlah penduduk, lahan yang tersedia,dll. Model analisis yang digunakan dalam membangun aplikasi ini adalah pemodelan berbasis objek dengan menggunakan UML. Berdasarkan hasil penelitian yang telah dilakukan, Dengan penggambaran menggunakan peta digital yaitu menggunakan fasilitas Google Maps (GMaps)informasi kegiatan pada setiap kabupaten/kota menjadi lebih akurat dan penggunaan metode AHP dalam aplikasi ini mampu memberikan rekomendasi lokasi kegiatan pembangunan dengan berdasarkan kriteria masing kegiatan pada kabupaten/kota tersebut.Kata kunci: pemetaan, sig, uml, gmaps, rekomendasi, ahp.','abstrak sistem informasi geografis meta nas mukim rumah provinsi jawa basis web nazmudin firdaos tingkat tumbuh duduk provinsi jawa imbang ketersediaan sarana prasarana kualitas nas mukim rumah diskimrum tugas mengoptimalkandan tata lahan bangun laksana olah data meta giat peta konvensional kurang informasi objek peta lengkap dokumentasi lapor upa jurnal sistem informasi geografissig visualisasi sebar data mudah guna oleh informasi analisa data metode ahp analytic hierarchy processing data o kriteria bobot tertentu tentu rekomendasi lokasi pembangunanberdasarkan data oleh data duduk lahan tersediadll model analisis bangun aplikasi model basis objek uml penelitian gambar peta digital fasilitas google maps gmapsinformasi kabupatenkota akurat metode ahp aplikasi rekomendasi lokasi bangun kriteria masing kabupatenkota kunci meta sig uml gmaps rekomendasi ahp'),(12,'IS','ABSTRAK SISTEM INFORMASI MONITORING TENAGA KERJA LAPANGAN BERBASIS MOBILE DI PT.PLN (PERSERO) DISTRIBUSI JAWA BARAT DAN BANTEN AREA BANDUNGOleh : Fajar Insan Asshidiq 10109428.PT PLN (Persero) bekerjasama dengan pihak ketiga, PT. Haleyora Powerindo dalam hal penyerahan salah satu pekerjaan untuk menangani pekerjaan pelayanan dan teknik (Yantek). Berdasarkan wawancara dengan supervisor teknik PT.PLN (Persero) , proses pelaporan data dan hasil pemeriksaan di lapangan memakan waktu yang cukup lama, monitoring(pemantauan) tenaga kerja lapangan oleh supervisor teknik dan koordinator yantek melalui laporan bulanan sehingga respon time dan recovery time yang tidak sesuai dengan SLA tidak dapat diketahui secara real time. Laporan bulanan masih berupa manual sehingga proses rekap dan pencarian laporan gangguan memakan waktu yang cukup lama. Pendekatan untuk menyelesaikan permasalahan yang telah diuraikan adalah dengan membangun sebuah Sistem Informasi Monitoring Tenaga Kerja Lapangan. Sistem ini menggunakan sebuah metode yaitu key performance indicator untuk memantau tenaga kerja lapangan saat menangani gangguan. Sistem ini menggunakan model pembangunan perangkat lunak yaitu model waterfall, sedangkan analisis sistem menggunakan pemodelan berorientasi objek dengan menggunakan Unified Modelling Language (UML) Berdasarkan implementasi dan pengujian yang telah dilakukan maka dapat disimpulkan bahwa sistem informasi monitoring tenaga kerja lapangan yang dibangun membantu proses pemantauan tenaga kerja lapangan, rekap gangguan , proses penyampaian informasi  menjadi lebih cepat. Namun perlu adanya pengembangan dalam pemantauan tenaga kerja lapangan yaitu posisi lokasi tenaga kerja lapangan saat dilapangan.Kata kunci : Sistem , monitoring , PT.PLN, tenaga kerja lapangan, key performance indicator.','abstrak sistem informasi monitoring tenaga lapang basis mobile ptpln sero distribusi jawa banten area bandung fajar insan asshidiq pt pln sero bekerjasama pt haleyora powerindo serah kerja menangani kerja layan teknik yantek wawancara supervisor teknik ptpln sero lapor data pemeriksaan lapang akan monitoringpemantauan tenaga lapang supervisor teknik koordinator yantek lapor bulan respon time recovery time sla tahu real time lapor bulan upa manual rekap cari lapor ganggu akan dekat selesai masalah urai bangun sistem informasi monitoring tenaga lapang sistem metode y performance indicator pantau tenaga lapang menangani ganggu sistem model bangun angkat lunak model waterfall analisis sistem model orientasi objek unified modelling language uml implementasi uji simpul sistem informasi monitoring tenaga lapang bangun pemantauan tenaga lapang rekap ganggu sampai informasi cepat pengembangan pemantauan tenaga lapang lokasi tenaga lapang lapang kunci sistem monitoring ptpln tenaga lapang y performance indicator'),(13,'IS','ABSTRAKSISTEM PENDUKUNG KEPUTUSAN UNTUK MENENTUKAN KELAIKAN OPERASI SARANA KERETA DI PT. KERETA API INDONESIA (PERSERO) DAOP 2 BANDUNG DENGAN MENGGUNAKAN METODE ANALYTICAL HIERARCHY PROCESSOleh : NUR HARDIYANTO 10110917.Pendekatan menentukan kelaikan operasi sarana kereta merupakan serangkaian pemeriksaan komponen - komponen kereta yang harus memenuhi persyaratan ambang batas laik jalan, untuk memastikan sarana kereta yang akan dioperasikan dalam kondisi teknis baik demi menjaga keselamatan dan kenyamanan selama dalam perjalanan. Banyaknya kriteria dan subkriteria yang harus diuji serta adanya perbedaan penilaian yaitu penilaian berupa angka dan abjad menyebabkan penilaian pada proses pemeriksaan pengujian komponen sarana kereta cenderung bersifat subjektif. Hal tersebut juga dapat menyebabkan terjadinya peluang kesalahan dalam melakukan analisis pemeriksaan hasil pengujian kondisi fisik kereta. Di sisi lain penentuan kelaikan operasi sarana kereta harus dilakukan dengan lebih berhati-hati, tepat, cermat, dan cepat. Analisis kelaikan operasi sarana kereta memanfaatkan Metode Analytical Hierarchy Process (AHP) sebagai metode dari Sistem Pendukung Keputusan (SPK) dalam proses analisis data kereta yang menggunakan beberapa kriteria untuk memilih prioritas pengujian kereta, yang digunakan sebagai acuan dalam menentukan kelaikan operasi sarana kereta yang tepat. Metode teknik pengumpulan data, studi literatur, observasi dan wawancara digunakan untuk masalah-masalah yang terkait. Tahap pembangunan sistem menggunakan pendekatan terstruktur. Metode pembangunan sistem dengan model Waterfall, analisis perancangan meliputi Flowmap, Diagram Konteks, Kamus Data, Data Flow Diagram (DFD) dan konseptual rancang basis data menggunakan Entity Relationship Diagram (ERD). Implementasi sistem menggunakan alat seperti Borland Delphi 7.0 sebagai desain tampilan antarmuka dan MySQL sebagai pengolahan database. Pengujian sistem dilakukan dengan pengujian black box serta wawancara. Berdasarkan hasil pengujian yang telah dilakukan dapat disimpulkan bahwa aplikasi ini dapat memberikan rekomendasi dalam pengambilan keputusan menentukan kelaikan operasi sarana kereta berdasakan hasil nilai yang objektif pada penilaian pengujian kelaikan operasi sarana kereta, mengurangi peluang terjadinya kesalahan dalam melakukan analisis pemeriksaan hasil pengujian kondisi fisik kereta, serta membantu memudahkan proses pengambilan keputusan untuk menentukan kelaikan sarana kereta sehingga dapat mengoptimalkan tindakan yang dilakukan.Kata Kunci: Sistem Pendukung Keputusan, Kelaikan Operasi Sarana Kereta, Analytical Hierarchy Process','abstrak sistem dukung tentu lai operasi sarana kereta pt kereta api indonesia sero daop bandung metode analytical hierarchy process nur hardiyanto dekat tentu lai operasi sarana kereta rangkai pemeriksaan komponen komponen kereta penuh syarat ambang batas laik pasti sarana kereta operasi teknis demi jaga selamat nyaman jalan banyak kriteria subkriteria uji beda nilai nilai upa angka abjad nilai pemeriksaan uji komponen sarana kereta cenderung sifat subjektif jadi luang salah analisis pemeriksaan uji fisik kereta sisi penentuan lai operasi sarana kereta hati tepat cermat cepat analisis lai operasi sarana kereta manfaat metode analytical hierarchy process ahp metode sistem dukung spk analisis data kereta kriteria pilih prioritas uji kereta acu tentu lai operasi sarana kereta tepat metode teknik pengumpulan data studi literatur observasi wawancara masalah tahap bangun sistem dekat struktur metode bangun sistem model waterfall analisis rancang liput flowmap diagram konteks kamus data data flow diagram dfd konseptual rancang basis data entity relationship diagram erd implementasi sistem alat borland delphi desain tampil antarmuka mysql olah database uji sistem uji black box wawancara uji simpul aplikasi rekomendasi ambil tentu lai operasi sarana kereta berdasakan nilai objektif nilai uji lai operasi sarana kereta urang luang jadi salah analisis pemeriksaan uji fisik kereta mudah ambil tentu lai sarana kereta optimal tindak kunci sistem dukung lai operasi sarana kereta analytical hierarchy process'),(14,'IS','ABSTRAK PEMBANGUNAN SISTEM INFORMASI DISTRIBUSI PRODUK PT. SEANTERO GUMILANG LESTARI DENGAN PENDEKATAN METODE SUPPLY CHAIN MANAGEMENTOLEH : GILANG PURNAMA 10110559.PT. Seantero Gumilang Lestari adalah perusahaan yang memproduksi pakaian jadi dewasa jenis sweater, jacket dan  t-shirt. Produk yang dihasilkan PT. Seantero Gumilang Lestari dipasarkan baik dalam negeri maupun ke luar negeri. Perusahaan memesan bahan baku kepada supplier untuk memenuhi kebutuhan produksi yang diminta oleh buyer, dimana pemesanan bahan baku yang dilakukan kepada supplier memiliki jeda waktu tunggu yang cukup lama bisa mencapai tiga minggu antara pemesanan sampai bahan baku diterima perusahaan sehingga gudang seringkali terjadi keterlambatan dalam menerima bahan baku dan kekurangan stok produk. Buyer pun terkadang memesan produk yang lebih dari biasanya ataupun sebaliknya, sehingga perusahaan mengalami kesulitan dalam hal menentukan jumlah bahan baku yang harus disiapkan untuk memenuhi kebutuhan pasokan produk.Berdasarkan permasalahan diatas untuk mengatasi permasalahan tersebut dengan membangun sistem informasi distribusi produk PT. Seangtero Gumilang Lestari dengan pendekatan metode supply chain management. Tujuannya adalah untuk mempermudah perusahaan dalam hal menentukan jumlah bahan baku yang harus disiapkan untuk memenuhi kebutuhan pasokan produk sehingga perencanaan produksi dan proses produksi berjalan dengan lancar dan menghindari terjadinya kekurangan / kekosongan stok produk di gudang PT. Seantero Gumilang Lestari sehingga pendistribusian produk berjalan dengan lancar. Metode peramalan yang digunakan adalah single exponential smoothing. Perhitungan dalam menentukan jumlah persediaan produk menggunakan safety stock. Berdasarkan hasil pengujian dapat disimpulkan bahwa sistem ini sudah membantu PT. Seantero Gumilang Lestari dalam menentukan jumlah bahan baku yang dipesan, mengendalikan data produk dan bahan baku, mendapatkan informasi pengiriman produk dan melakukan persetujuan pemesanan produk dan pengadaan bahan baku.Kata Kunci : Supply Chain Management, Single Exponential Smoothing, Safety Stock.','abstrak bangun sistem informasi distribusi produk pt antero gumilang lestari dekat metode supply chain management gilang purnama pt antero gumilang lestari usaha produksi pakai dewasa sweater jacket t produk hasil pt antero gumilang lestari pasar neger neger usaha es bahan baku supplier penuh produksi minta buyer mana mesan bahan baku supplier jeda tunggu mesan bahan baku terima usaha gudang seringkali lambat bahan baku kurang stok produk buyer kadang es produk atau balik usaha sulit tentu bahan baku siap penuh pasok produkberdasarkan masalah atas atas masalah bangun sistem informasi distribusi produk pt seangtero gumilang lestari dekat metode supply chain management tuju mudah usaha tentu bahan baku siap penuh pasok produk rencana produksi produksi lancar hindar jadi kurang kosong stok produk gudang pt antero gumilang lestari distribusi produk lancar metode ramal single exponential smoothing hitung tentu sedia produk safety stock uji simpul sistem pt antero gumilang lestari tentu bahan baku pesan kendali data produk bahan baku informasi pengiriman produk tuju mesan produk ada bahan baku kunci supply chain management single exponential smoothing safety stock'),(15,'CS','ABSTRAK ANALISIS DAN IMPLEMENTASI ALGORITMA 3D-DCT DENGAN MENGGUNAKAN PENGKODEAN CABAC PADA KOMPRESI VIDEO H.265/HEVCOleh : ALINTIA ROSSI 10111275.Kebutuhan akan file-file multimedia, seperti video dalam jumlah yang besar, membutuhkan ruang penyimpanan yang besar pula. Oleh karena itu diperlukan sebuah metode kompresi yang sesuai agar menghasilkan rasio kompresi yang cukup besar namun tidak mengurangi kualitas video tersebut.Pada tugas akhir ini dikembangkan suatu metode kombinasi algoritma 3D-DCT (Three Dimension-DCT) pada proses transfrom-nya dengan algoritma fast coding unit decision algorithm pada CU (Coding Unit) untuk menghasilkan peningkatan optimalisasi waktu kompresi (encoding time) dan ukuran bit rate (size) yang lebih baik. Algoritma 3D-DCT melibatkan sedikit operasi dan dapat berjalan lebih cepat, metode yang ideal dalam mengubah image dari domain spasial ke domain frekuensi, sehingga citra terkonsentrasi hanya dalam beberapa koefisien DCT. Untuk mengetahui performansi hasil proses kompresi dilakukan perhitungan PSNR dan rasio kompresi. Berdasarkan seluruh pengujian, sistem kompresi menggunakan algoritma 3D-DCT yang dikombinasikan dengan  algoritma fast coding unit decision mampu meningkatkan kinerja aplikasi dari sisi optimalisasi ukuran file setelah dikompresi dengan hasil rasio pemampatan (nisbah)  sebesar ?50% dengan waktu yang lebih cepat dengan nilai PSNR rata-rata >20 dB.Kata Kunci : Kompresi Video, 3D-DCT, fast coding unit decision algorithm, CABAC','abstrak analisis implementasi algoritma d kode cabac kompresi video hhevc alintia rossi file multimedia video butuh simpan perlu metode kompresi hasil rasio kompresi urang kualitas video tersebutpada tugas kembang metode kombinasi algoritma d three dimension transfrom algoritma fast coding unit decision algorithm cu coding unit hasil peningkatan optimalisasi kompresi encoding time ukur bit rate size algoritma d libat operasi cepat metode ideal ubah image domain spasial domain frekuensi citra konsentrasi koefisien dct performansi kompresi hitung psnr rasio kompresi uji sistem kompresi algoritma d kombinasi algoritma fast coding unit decision kinerja aplikasi sisi optimalisasi ukur file kompresi rasio pemampatan nisbah cepat nilai psnr rata db kunci kompresi video d fast coding unit decision algorithm cabac'),(16,'CS','ABSTRAK ANALISIS SELF-MODIFYING CODE MENGGUNAKAN DYNAMIC BINARY INSTRUMENTATIONOleh : TEGUH PRIMA ALKO 10109383.Self-Modifying Code merupakan sebuah teknik pemograman yang sering digunakan untuk perangkat lunak komersil dalam melindungi lisensi dari pembajakan serta malicious software dalam menyembunyikan eksistensinya. Hal tersebut menjadi tantangan pada dunia reverse engineering karena sulit dianalisis secara statis. Adapun masalah utama dari Self-Modifying Code adalah subtitusi fungsi yang hanya dapat diketahui ketika eksekusi. Aplikasi debugger umumnya hanya dapat mengontrol arus data yang tidak berbeda sikap instruksi pada saat setiap kali program mendapatkan eksepsi debug. Proses debugging secara manual juga memakan waktu lama karena terpaku pada panjang kode instruksi. Hal ini dapat diatasi dengan menanamkan kode monitoring secara dinamis pada program atau dikenal sebagai Dynamic Binary Instrumentation. Sistem DBI dibangun menggunakan framework  dari DynamoRIO yang memenuhi kebetuhan untuk Self-Modifying Code seperti menganalisis tingkah lakunya, analisis  keluaran yang mudah dimengerti berupa representasi atau bahasa pemograman tingkat menengah dan analisis akurasi yang tepat atau jauh dari false positive. Berdasarkan hasil analisis dan implementasi yang telah dilakukan, maka dihasilkan plugin untuk DynamoRIO. Setelah plugin tersebut dibangun, maka dilakukan pengujian terhadap program Self-Modifying Code. Adapun hasil yang didapat, plugin ini dapat mempermudah reverse engineer untuk menghadapi kasus program Self-Modifying Code karena menyediakan keluaran yang sederhana.Kata Kunci: Anti-Debugging, Binary Analysis.','abstrak analisis self code dynamic binary instrumentation teguh prima alko self code teknik pemograman angkat lunak komersil lindung lisensi bajak malicious software sembunyi eksistensi tantang dunia reverse engineering sulit analisis statis adapun self code subtitusi fungsi tahu eksekusi aplikasi debugger umum kontrol arus data beda sikap instruksi eksepsi debug debugging manual akan terpa kode instruksi atas tanam kode monitoring dinamis kenal dynamic binary instrumentation sistem dbi bangun framework dynamorio penuh kebetuhan self code analisis tingkah la analisis luar mudah erti upa representasi bahasa pemograman tengah analisis akurasi tepat false positive analisis implementasi hasil plugin dynamorio plugin bangun uji self code adapun dapat plugin mudah reverse engineer kasus self code sedia luar sederhana kunci anti binary analysis'),(17,'CS','ABSTRAK IMPLEMENTASI MULTI-AGENT PATH FINDING MENGGUNAKAN ALGORITMA WHCA* PADA WEBOTSOleh : FAZHAL DARUL FARHI 10112901.Perkembangan  mobile robot dewasa ini sangat pesat, beriringan dengan kebutuhan akan tenaga – tenaga pembantu manusia yang cepat dan handal, salah satunya webots, yaitu mobile robot yang ciri khasnya adalah mempunyai aktuator berupa roda untuk menggerakan keseluruhan badan robot sehingga robot tersebut dapat melakukan perpindahan posisi dari satu titik ke titik lainnya. Dalam perkembangannya mobile robot dapat digunakan dalam suatu industri, dengan adanya mobile robot maka proses distribusi dalam industri akan lebih cepat. Untuk menjadi lebih cepat dalam mencapai tujuannya mobile robot harus dapat menghindari rute – rute yang dapat menyebabkan tabrakan atau menghindari hambatan. Berdasarkan hal tersebut dibutuhkan sebuah metode atau algoritma pencarian jalur terpendek dan agent harus menghindari rute yang dapat menyebabkan tabrakan dengan agent lainnya. Algoritma Windowed Hierarchical Cooperative A* merupakan pengembangan algoritma A* dalam pencarian jalur terpendek dengan banyak agent yang mana setiap agent saling tukar informasi tentang rute yang akan dilalui sehingga tidak menyebabkan tabrakan antar agent dengan membatasi ruang-waktu pencarian mendalam untuk jendela yang dinamis, menyebarkan perhitungan selama durasi rute. Berdasarkan hasil uji coba yang telah dilakukan, Semakin banyaknya agen dan jumlah grid maka proses pencarian jalur terpendek menggunakan WHCA* akan semakin lama dan jumlah ekspansi node akan semakin banyak.Kata Kunci : webots, WHCA*, multi agent, pathfinding','abstrak implementasi multi path finding algoritma whca* webots fazhal darul farhi kembang mobile robot dewasa pesat beriringan tenaga tenaga bantu manusia cepat handal satu webots mobile robot ciri khas aktuator upa roda gerak seluruh robot robot pindah titik titik kembang mobile robot industri mobile robot distribusi industri cepat cepat tuju mobile robot hindar rute rute tabrak hindar hambat butuh metode algoritma cari jalur terpendek agent hindar rute tabrak agent algoritma windowed hierarchical cooperative a* pengembangan algoritma a* cari jalur terpendek agent agent saling tukar informasi rute lalu tabrak antar agent batas ruang cari dalam jendela dinamis sebar hitung durasi rute uji coba banyak agen grid cari jalur terpendek whca* ekspansi node kunci webots whca* multi agent pathfinding'),(18,'IS','ABSTRAK PEMBANGUNAN HOSPITAL QUALITY CONTROL (HQC) DI RUMAH SAKIT MATA CICENDO BANDUNGOleh : YOHAN ABEDNEGO TAMBUNAN 1011382.Rumah Sakit Mata Cicendo yang ditunjuk oleh pemerintah sebagai Pusat Mata Nasional memliki peran yang sangat penting dalam menjaga kesehatan masyarakat terutama dalah hal kesehatan mata.Pelayanan dan managemen yang kuat merupakan kunci dalam menjaga serta membangun kepercayaan masyarakat.Dalam hal ini direksi memliki peran yang sangat penting untuk mengawasi setiap kegiatan yang terdapat di rumah sakit, direksi yang mempunyai pedoman berupa kamus indikator kinerja rumah sakit dan balai yang dikeluarkan pemerintah pada tanggal 13 Januari 2015 menjadi acuan dalam menilai kinerja rumah sakti.Sistem controling yang dibangun menggunkan metode Analitycal Hierarchy Process (AHP) yang diberi nama Hospital Quality Control (HQC). AHP merupkan metode pengambilan keputusan dengan memiliki berbagai alternatif dan memiliki banyak faktor yang berpengaruh dalam perhitungan.Melalui metode ini  yang diterapkan pada aplikasi HQC diharapkan dapat membantu direksi dalam perhitungan kualitas rumah sakit untuk nantinya dijadikan sebagai acuan untuk memberikan evaluasi kepada setiap bagian di dalam rumah sakit.Perhitungan AHP yang dilakukan adalah untuk mendapatkan batas nilai maksimal dan minimal dari kualitas rumah sakit berdasarkan kamus indikator, nilai tersebut didapat dari pengelompokan kategori berdasarkan jumlah indikator yang berjumlah 92 indikator yang dikelompokan menjadi 16 kategori, stiap indikator mempunyai nilai didalamnya yang dimasukan oleh kepala bagian di Rumah Sakit Mata Cicendo.Tools pengembangan perangkat lunak pada sistem ini menggunakan metode objek oriented dengan Unified Modeling Language (UML) dalam menggambarkan fungsional dan aliran data yang terdapat pada sistem ini. Setelah melalukan pengujian Black Box dan pengujian Betha dengan metode wawancara dengan beberapa kepala bagian dan direksi.Hasil dari penelitian ini adalah aplikasi ini mampu memudahkan direksi untuk controling setiap bagian di Rumah Sakit Mata Cicendo, serta memudahkan kepala bagian dalam pengisian data kedalam sistem, sehingga evaluasi dan keputusan yang di berikan bisa optimal.Kata kunci : Analythical Hierarchy Process,Controling,Kualitas Rumah Sakit','abstrak bangun hospital quality control hqc rumah sakit mata cicendo bandung yohan abednego tambun rumah sakit mata cicendo tunjuk pemerintah pusat mata nasional lik peran jaga sehat masyarakat da sehat matapelayanan managemen kuat kunci jaga bangun percaya masyarakatdalam direksi lik peran awas dapat rumah sakit direksi pedoman upa kamus indikator kinerja rumah sakit balai keluar pemerintah januari acu nilai kinerja rumah saktisistem controling bangun gun metode analitycal hierarchy process ahp beri hospital quality control hqc ahp merupkan metode ambil alternatif faktor pengaruh perhitunganmelalui metode terap aplikasi hqc harap direksi hitung kualitas rumah sakit nanti jadi acu evaluasi rumah sakitperhitungan ahp batas nilai maksimal minimal kualitas rumah sakit kamus indikator nilai dapat pengelompokan kategori indikator berjum indikator kelompok kategori stiap indikator nilai dalam masuk kepala rumah sakit mata cicendotools pengembangan angkat lunak sistem metode objek oriented unified modeling language uml gambar fungsional alir data dapat sistem lalu uji black box uji betha metode wawancara kepala direksihasil penelitian aplikasi mudah direksi controling rumah sakit mata cicendo mudah kepala isi data dalam sistem evaluasi berik optimal kunci analythical hierarchy processcontrolingkualitas rumah sakit'),(19,'IS','ABSTRAK PEMBANGUNAN SISTEM EVALUASI UNTUK MENGETAHUI KEMAMPUAN PEMAHAMAN SISWA TERHADAP MATERI PEMBELAJARAN BERDASARKAN HASIL TRYOUT BERBASIS WEB DI SMAN 10 BANDUNGOleh : SEPTIYAN HENDIYANA 10110508.Kegiatan evaluasi hasil belajar merupakan kegiatan yang harus dilakukan oleh guru di SMAN 10 Bandung untuk dapat mengetahui sejauh mana perkembangan peserta didik selama mengikuti kegiatan belajar di sekolah dengan cara menganalisis tingkat kemampuan pemahaman siswa. Hasil evaluasi ini diperlukan untuk menunjang kegiatan pemantapan berdasarkan hasil tryout. Namun, kegiatan evaluasi sering terjadi kendala. Untuk mendapatkan hasil analisis tingkat kemampuan siswa, dibutuhkan waktu yang cukup lama karena guru harus memeriksa dan mencocokan kembali jawaban siswa dengan soal-soal yang diujikan. Pada sistem yang ada saat ini, belum ada fitur yang dapat membantu kegiatan evaluasi tersebut. Berdasarkan masalah di atas, solusi untuk menyelesaikannya yaitu dengan membangun sistem evaluasi yang diintegrasikan dengan Learning Management System (LMS) yang ada di SMAN 10 Bandung. Adapun alat yang digunakan untuk menggambarkan model sistem yaitu diagram alir data (Flowmap), diagram konteks, dan Data Flow Diagram (DFD), dan untuk perancangan basis data menggunakan kamus data dan Entity Relationship Diagram (ERD). Metode pengumpulan data yang digunakan adalah studi literatur, observasi, dan wawancara. Metode penelitian yang digunakan yaitu metode analisis deskriptif. Pengujian sistem evaluasi dilakukan menggunakan metode alpha dan beta. Pengujian alpha yaitu pengujian sistem yang dilakukan di lingkungan pengembang sistem, sedangkan pengujian beta yaitu pengujian yang dilakukan dengan melibatkan pihak pengguna yaitu guru. Hasil pengujian menyimpulkan bahwa pembangunan sistem evaluasi ini membantu guru dengan mempermudah dalam mendapatkan hasil analisis tingkat kemampuan pemahaman siswa dan hasil evaluasinya.Kata kunci : Sistem Evaluasi, Learning Management System, SMAN 10 Bandung, Analisis, Tingkat Kemampuan Pemahaman Siswa.','abstrak bangun sistem evaluasi mampu pemahaman siswa materi pembelajaran tryout basis web sman bandung septiyan hendiyana evaluasi belajar guru sman bandung jauh kembang serta didik ikut belajar sekolah analisis mampu pemahaman siswa evaluasi perlu tunjang mantap tryout evaluasi kendala analisis mampu siswa butuh guru periksa cocok jawab siswa soal uji sistem fitur evaluasi solusi selesai bangun sistem evaluasi integrasi learning management system lms sman bandung adapun alat gambar model sistem diagram alir data flowmap diagram konteks data flow diagram dfd rancang basis data kamus data entity relationship diagram erd metode pengumpulan data studi literatur observasi wawancara metode penelitian metode analisis deskriptif uji sistem evaluasi metode alpha beta uji alpha uji sistem lingkung pengembang sistem uji beta uji libat guna guru uji simpul bangun sistem evaluasi guru mudah analisis mampu pemahaman siswa evaluasi kunci sistem evaluasi learning management system sman bandung analisis mampu pemahaman siswa'),(20,'IS','ABSTRAK SISTEM INFORMASI MANAJEMEN PREVENTIVE MAINTENANCE BUS DI PT BHINNEKA SANGKURIANG TRANSPORTOleh : ANTON PRASETYO 10110669.PT. Bhinneka Sangkuriang Transport merupakan sebuah perusahaan yang bergerak dalam bidang jasa transportasi darat. Kelancaran sebuah perusahaan yang bergerak di bidang jasa transportasi sangat bergantung oleh bagaimana  cara mencegah kerusakan   armada bus. Selama ini sistem perawatan yang dilakukan masih bersifat korektif, dimana perawatan dilakukan setelah mesin bus mengalami kerusakan. Hal ini tentunya mengakibatkan banyaknya frekuensi breakdown terhadap armada bus sehingga menghambat kegiatan operasional. Tidak hanya itu, prosedur maintenance yang bersifat korektif mengakibatkan Kepala Workshop mengalami kesulitan dalam menjadwalkan kegiatan preventive maintenance guna mencegah kerusakan armada bus. Hal tersebut tentu berdampak pada sulitnya Manajer Operasional dalam melakukan monitoring kegiatan maintenance, dimana berdasarkan hasil  monitoring tersebut digunakan sebagai rekomendasi baik berupa penambahan maupun penggantian oli mesin terhadap armada bus. Sistem informasi manajemen preventive maintenance yang dibangun mengacu pada siklus Plan Do Check Act (PDCA) dimana siklus tersebut merupakan rangkaian kegiatan yang terdiri dari perencanaan kerja, pelaksanaan kerja, pengawasan kerja dan perbaikan kerja yang dilakukan terus menerus dan berkesinambungan. Metode analisis yang digunakan dalam pembangunan sistem menggunakan metode analisis terstruktur, dimana tools yang digunakan untuk memodelkan aliran data menggunakan Data Flow Diagram (DFD) dan memodelkan relasi antar data menggunakan Entity Relationship Diagram (ERD). Berdasarkan hasil pengujian dapat disimpulkan bahwa sistem ini dapat membantu pihak Departemen Operasional yakni Kepala Workshop dalam menjadwalkan kegiatan maintenance dan Manajer Operasional dalam melakukan monitoring terhadap kegiatan maintenance.Kata Kunci: Breakdown, Preventive Maintenance, PDCA, Monitoring','abstrak sistem informasi manajemen preventive maintenance bus pt bhinneka sangkuriang transport anton prasetyo pt bhinneka sangkuriang transport usaha gerak bidang jasa transportasi darat lancar usaha gerak bidang jasa transportasi gantung cegah rusak armada bus sistem rawat sifat korektif mana rawat mesin bus rusak tentu akibat banyak frekuensi breakdown armada bus hambat operasional prosedur maintenance sifat korektif akibat kepala workshop sulit jadwal preventive maintenance guna cegah rusak armada bus dampak sulit manajer operasional monitoring maintenance mana monitoring rekomendasi upa penambahan ganti oli mesin armada bus sistem informasi manajemen preventive maintenance bangun acu siklus plan do check act pdca mana siklus rangkai diri rencana laksana awas baik terus sinambung metode analisis bangun sistem metode analisis struktur mana tools model alir data data flow diagram dfd model relasi antar data entity relationship diagram erd uji simpul sistem departemen operasional kepala workshop jadwal maintenance manajer operasional monitoring maintenance kunci breakdown preventive maintenance pdca monitoring'),(21,'CS','ABSTRAK ANALISIS DAN IMPLEMENTASI MODEL NONDETERMINISTIC FINITE AUTOMATA DAN ALGORITMA LEVENSHTEIN UNTUK MEMBANGKITKAN AKORD DARI NOT ANGKAOleh : RUDI YUSUF 10111914.Algoritma Direct Product adalah algoritma perkalian langsung. Salah satu implementasi algoritma ini digunakan untuk membangkitkan komposisi akord dari notasi angka sebuah lagu. Sehingga komposisi akord sebuah lagu dapat terbentuk lebih dari satu buah komposisi akord. Cara kerja algoritma ini adalah dengan mengalikan kumpulan kumpulan akord bar lagu dalam sebuah lagu untuk menghasilkan beberapa komposisi akord lagu yang utuh dan bervariasi. Komposisi akord bar ini dihasilkan dengan menerapkan model Nondeterministic Finite Automata (NFA) kemudian dengan model akan dihasilkan komposisi-komposisi akord tiap bar lagu. Metode direct product merupakan metode perkalian langsung maka memori yang dibutuhkan dalam penggunaan implementasi ini sangat besar sehingga pembangkitan komposisi akord lagu pun cenderung terbatas disebabkan jumlah komposisi akord bar-nya yang terbatas. Algortima Levenshtein merupakan algoritma string matching yang digunakan untuk pengecekan antara 2 buah kata. Komposisi akord bar ini dibangkitkan dengan menggunakan metode Nondeterministic Finite Automata (NFA) Model selanjutnya akan dicek dengan algoritma levenshtein untuk memastikan bahwa komposisi akord yang terbentuk tidak tersedia pada kumpulan komposisi yang tersedia yang kemudian disimpan dalam alokasi memori. Pengecekan diharapkan dapat untuk menghindari penyimpanan komposisi akord yang sama sehingga penggunaan memori dapat diefisiensikan. Hasil dari pengujian menunjukan bahwa penggunaan alokasi memori dengan metode penerapan algoritma levenshtein terhadap metode sebelumnya didapatkan 59,59 % dan pengurangan sebanyak 40,41 % dari metode sebelumnya. Oleh karena itu penggunaan algoritma levenshtein mampu mengefisiensikan penggunaan memori namun dari pengujian penelitian yang dilakukan untuk menghitung kompleksits siklomatisnya, penerapan dengan metode ini masih terlalu besar yaitu sebanyak V(G) = 7 jika dibandingkan dengan metode sebelumnya yang hanya V(G)=4.Kata Kunci : Komposisi Akord, algoritma, direct product , levenshtein, model Nondeterministic Finite Automata (NFA)','abstrak analisis implementasi model nondeterministic finite automata algoritma levenshtein bangkit akord not angka rudi yusuf algoritma direct product algoritma kalian implementasi algoritma bangkit komposisi akord notasi angka lagu komposisi akord lagu terbentuk buah komposisi akord algoritma alik kumpul kumpul akord bar lagu lagu hasil komposisi akord lagu utuh variasi komposisi akord bar hasil terap model nondeterministic finite automata nfa model hasil komposisi akord tiap bar lagu metode direct product metode kalian memori butuh implementasi bangkit komposisi akord lagu cenderung batas sebab komposisi akord bar batas algortima levenshtein algoritma string matching ecek buah komposisi akord bar bangkit metode nondeterministic finite automata nfa model lanjut cek algoritma levenshtein pasti komposisi akord terbentuk tersedia kumpul komposisi tersedia simpan alokasi memori ecek harap hindar simpan komposisi akord memori efisiensi uji tunjuk alokasi memori metode penerapan algoritma levenshtein metode dapat urang metode algoritma levenshtein efisiensi memori uji penelitian hitung kompleksits siklomatis penerapan metode vg banding metode vg= kunci komposisi akord algoritma direct product levenshtein model nondeterministic finite automata nfa'),(22,'CS','ABSTRAK ANALISIS PERBANDINGAN STEGANOGRAFI METODE BIT-PLANE COMPLEXITY SEGMENTATION (BPCS) DAN METODE SPREAD SPECTRUM PADA CITRA DIGITALOleh : Nira Septisari Tanjung 10111281.Steganografi merupakan seni dan ilmu menulis dan menyembunyikan pesan tersembunyi dengan suatu cara, sehingga hanya si pengirim dan penerima yang mengetahui pesan tersembunyi. Beberapa metode steganografi telah dibandingan pada citra digital untuk mengetahui kelebihannya masing-masing seperti metode LSB dengan metode Bit-Plane Complexity Segmentation (BPCS) dan metode LSB dengan metode Spread Spectrum. Dalam penelitian ini membandingkan metode Bit-Plane Complexity Segmentation (BPCS) dengan metode Spread Spectrum pada citra digital sehingga mendapatkan hasil waktu penyisipan dan ekstrasi Spread Spectrum lebih cepat dibandingkan metode Bit-Plane Complexity Segmentation (BPCS) dan kualitas citra yang diukur dengan pengujian Peak Signal to Noise Ratio (PSNR) yang dihasilkan metode Bit-Plane Complexity Segmentation (BPCS) pada citra bmp rata-rata sebesar 70,85 db lebih baik dibandingkan metode Spread Spectrum yang rata-rata sebesar 64,62 db.Kata Kunci : Steganografi, Bit-Plane Complexity Segmentation (BPCS) , Spread Spectrum, Citra Digital','abstrak analisis banding steganografi metode bit complexity segmentation bpcs metode spread spectrum citra digital nira septisari tanjung steganografi seni ilmu tulis sembunyi pesan tersembunyi si pengirim penerima pesan tersembunyi metode steganografi banding citra digital lebih metode lsb metode bit complexity segmentation bpcs metode lsb metode spread spectrum penelitian banding metode bit complexity segmentation bpcs metode spread spectrum citra digital sisip ekstrasi spread spectrum cepat banding metode bit complexity segmentation bpcs kualitas citra ukur uji peak signal to noise ratio psnr hasil metode bit complexity segmentation bpcs citra bmp rata db banding metode spread spectrum rata db kunci steganografi bit complexity segmentation bpcs spread spectrum citra digital'),(23,'CS','ABSTRAK Implementasi Algoritma Pitch Detection Pada Aplikasi Pencarian Judul Lagu Melalui Media SuaraOleh : Nurul Aini Kastella 10109436.Musik yang dinyanyikan identik dengan vokal ,yang memiliki nada dan lirik .Menyanyi bukanlah sesuatu yang asing pada gaya hidup zaman sekarang .Namun, terdapat beberapa masalah yang ada seperti sulitnya mengingat suatu lirik lagu dan judul lagu atau mencari lagu berdasarkan judul dengan cara yang mudah, efektif dan cepat, sehingga dibutuhkan media informasi yang dapat menjadi fasilitas dalam pemakaian aplikasi pencarian judul lagu. Media informasi tersebut dibutuhkan untuk membantu pengguna agar menjadi sarana pilihan utama untuk melakukan pencarian lirik lagu. Melalui pencarian pitch pada suara manusia pada lagu di harapkan pitch detection ini dapat mendeteksi data lagu yang dihasilkan berupa judul lagu setelah proses filter yang digunakan sehingga pendeteksian mendapatkan keluaran yang diharapkan. Penelitian ini membahas mengenai pencocokan suara yang masuk dengan judul lagu yang berada di folder lagu. Pengujian ini dilakukan berdasarkan beberapa kondisi dengan menggunakan bahasa inggris diantaranya, pengambilan data suara masukkan dengan 1 kata , pengambilan data suara masukkan dengan 2 kata, pengambilan data suara masukkan dengan 3 kata , pengambilan data suara masukkan dengan 4 kata, pengambilan data suara masukkan dengan 5 kata dan pengambilan data suara masukkan dengan 6 kata atau 1 baris lirik dan hasilnya menunjukan presentase yang bagus hingga pencarian dengan 5 kata , setelah suara masukkan dengan 6 kata atau 1 baris lirik tingkat keakuratan menurun atau harus melakukan pencarian berulang.Kata kunci : Judul Lagu, Pitch Detection ,Short Time (STFT), pengolahan sinyal','abstrak implementasi algoritma pitch detection aplikasi cari judul lagu media suara nurul ain kastella musik nyanyi identik vokal nada lirik nyanyi buk suatu asing gaya zaman dapat sulit ingat lirik lagu judul lagu lagu judul mudah efektif cepat butuh media informasi fasilitas pemakaian aplikasi cari judul lagu media informasi butuh guna sarana pilih cari lirik lagu cari pitch suara manusia lagu harap pitch detection deteksi data lagu hasil upa judul lagu filter deteksi luar harap penelitian bahas cocok suara judul lagu folder lagu uji bahasa inggris antara ambil data suara masuk ambil data suara masuk ambil data suara masuk ambil data suara masuk ambil data suara masuk ambil data suara masuk baris lirik hasil tunjuk presentase bagus cari suara masuk baris lirik akurat turun cari ulang kunci judul lagu pitch detection short time stft olah sinyal'),(24,'CS','ABSTRAK IMPLEMENTASI LOGIKA FUZZY SEBAGAI PENGATUR KECEPATAN PEMBUKA PINTU PADA ROLE PLAYING GAME BATTERY-MANOleh : YAYA ABDUL SOMAD 10109542.Game Battery-man merupakan game berjenis simulation game. Game Battery-man ini memiliki konsep permainan pengatur kecepatan pembuka pintu untuk mengambil keputusan sangat lambat, lambat, sedang, cepat, dan sangat lambat sekali. Kecepatan pembuka pintu akan sangat menentukan kesuksesan pemain dalam game ini. Pengambilan baterai akan membutuhkan waktu, jika pemain hanya mengambil baterai dalam jumlah sedikit, maka waktu yang dibutuhkan juga sedikit. Sebaliknya, jika pemain mengambil baterai yang banyak, maka akan membutuhkan waktu yang cukup lama. Tetapi disisi lain, jika baterai tidak sesuai untuk membuka pintu  maka kecepatan pintu akan sangat lambat, jika jumlah baterai sesuai dengan yang diperlukan oleh penggerak pintu, maka kecepatannya akan cepat. Namun pada game simulasi Battery – Man membutuhkan suatu algoritma yang dapat menentukan nilai untuk 2 variabel yaitu tegangan dan arus. Berdasarkan penjelasan di atas maka dibutuhkan algoritma logika fuzzy ke dalam game Battery-Man sebagai pengatur kecepatan pembuka pintu untuk mengambil keputusan sangat lambat, lambat, sedang, cepat, dan sangat lambat sekali. Dari hasil pengujian yang dilakukan, dapat disimpulkan bahwa implementasi logika fuzzy dalam game Battery-Man ini telah memenuhi tujuan, yaitu dapat menghasilkan output berupa aksi-aksi sesuai dengan kondisinya seperti sangat lambat, lambat, sedang, cepat, sangat lambat sekali berdasarkan variabel fuzzy tegangan dan arus.Kata Kunci: Logika Fuzzy, Tegangan, Arus.','abstrak implementasi logika fuzzy atur cepat buka pintu role playing game battery yaya abdul somad game battery game jenis simulation game game battery konsep main atur cepat buka pintu lambat lambat cepat lambat cepat buka pintu tentu sukses main game ambil baterai butuh main baterai butuh balik main baterai butuh sisi baterai buka pintu cepat pintu lambat baterai perlu gerak pintu cepat cepat game simulasi battery man butuh algoritma tentu nilai variabel tegang arus jelas butuh algoritma logika fuzzy game battery atur cepat buka pintu lambat lambat cepat lambat uji simpul implementasi logika fuzzy game battery penuh tuju hasil output upa aksi kondisi lambat lambat cepat lambat variabel fuzzy tegang arus kunci logika fuzzy tegang arus'),(25,'CS','ABSTRAK IMPLEMENTASI LOGIKA FUZZY UNTUK MEREPRESENTASIKAN KEMATANGAN MASAKAN PADA GAME MARI MEMASAKOLEH : YUSUF DWIKARYA 10110032.Dalam kasus menentukan keputusan kematangan masakan pada game mari memasak yang dipengaruhi dengan pemberian suhu api dan waktu memasak yang sesuai.. Untuk dapat berhasil pada misi memasak pemain harus dapat menentukan keputusan kematangan masakan berdasarkan pemberian suhu api dan waktu memasak yang sesuai takaranya. Logika fuzzy merupakan salah satu metode yang memetakan ruang input terhadap ruang output. Dengan metode fuzzy logic Tsukamoto akan memperoleh output dilakukan dalam tahap – tahap fuzzyfikasi, inferensi, Penegasan (defuzzyfikasi). Penggunaan logika fuzzy telah menghasilkan keputusan tingkat kematangan pada game mari memasak dengan cara menjadikan variabel input suhu api dan waktu memasak dengan tingkat kematangan masakan sebagai output keputusan  menghitung menggunakan tahapan-tahapan fuzzy logic sehingga keputusan dihasilkan secara akurat. Kata Kunci: Logika fuzzy, implementasi, algoritma, Tsukamoto.','abstrak implementasi logika fuzzy representasi matang masak game mari asak yusuf dwikarya kasus tentu matang masak game mari asak pengaruh beri suhu api asak hasil misi asak main tentu matang masak beri suhu api asak takara logika fuzzy metode eta input output metode fuzzy logic tsukamoto oleh output tahap tahap fuzzyfikasi inferensi penegasan defuzzyfikasi logika fuzzy hasil matang game mari asak jadi variabel input suhu api asak matang masak output hitung tahap fuzzy logic hasil akurat kunci logika fuzzy implementasi algoritma tsukamoto'),(26,'IT','ABSTRAK PEMBANGUNAN SISTEM KEAMANAN WEBSITE UNTUK PEMBLOKIRAN SPAM DAN BOT SPAM Oleh CHARLEY SAKUL 10104525 Banyak situs-situs di internet yang terserang spam dan bot-bot spam. Untuk itu diperlukan suatu sistem keamanan website yang dapat menangani permasalahan spam dan bot-bot spam tersebut. Tugas akhir ini adalah untuk memenuhi kebutuhan tersebut. Sistem keamanan website yang dibuat ini terbagi menjadi 2 bagian, yaitu pemblokiran bot spam dan penyaringan atau pendeteksian komentar yang mengandung spam. Komentar yang termasuk dalam kategori spam akan diblok dan tidak akan terkirim. Yang diharapkan adalah semua komentar yang terkirim adalah bebas dari spam dan bot-bot spam. Tujuan utama pembuatan sistem keamanan website ini adalah agar website dapat aman, bebas dan bersih dari penyerangan spam dan bot-bot spam. Kata kunci : Pemblokiran spam dan bot spam, sistem keamanan website.','abstrak bangun sistem aman website blokir spam bot spam charley sakul situs internet serang spam bot spam perlu sistem aman website menangani masalah spam bot spam tugas penuh sistem aman website buat bagi blokir bot spam saring deteksi komentar kandung spam komentar kategori spam blok kirim harap komentar kirim bebas spam bot spam tuju buat sistem aman website website aman bebas bersih serang spam bot spam kunci blokir spam bot spam sistem aman website');

